webpackJsonp([0x8909e5f584f0],{505:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Elvin's Blog",author:"Elvin Ma"}},markdownRemark:{id:"/Users/maxingcong/Code/blog/src/pages/迷你项目汇总.md absPath of file >>> MarkdownRemark",html:'<p>汇总一下自己曾经做的一些有意思的迷你项目：</p>\n<h3>Mr.Beard</h3>\n<p>通过getUserMedia API和Chrome的实验性FaceDetector API实现打开前摄相头并检测人脸加上胡子</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/mr-beard">mr-bread</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/mr-beard">Mr.Beard</a></p>\n<h3>3D Attendance</h3>\n<p>头像组成的3D签到效果，包括球型、立方体和文字等，ThreeJS和Canvas版本</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/3d-geometry">3d-geometry</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/3d-geometry">3D Attendance</a></p>\n<h3>Code Matrix</h3>\n<p>基于Canvas实现的类似黑客帝国代码矩阵效果，支持自定义文字</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/code-matrix">code-matrix</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/code-matrix">Code Matrix</a></p>\n<h3>Vue UI Components</h3>\n<p>项目用UI组件库，包括常用基础组件，交互组件和业务组件</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/vue-ui-components">vue-ui-components</a></p>\n<h3>Weather Canvas</h3>\n<p>基于Canvas实现的可切换的天气效果</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/weather-canvas">weather-canvas</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/weather-canvas">Weather Canvas</a></p>\n<h3>Doodle Jump</h3>\n<p>Canvas实现的网页版涂鸦跳跃游戏，支持重力感应</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/doodle-jump">doodle-jump</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/doodle-jump">Doodle Jump</a></p>\n<h3>Snake Game</h3>\n<p>P5.JS实现的简单贪吃蛇游戏</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/snake">snake</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/snake">Snake Game</a></p>\n<h3>Mind Map</h3>\n<p>D3.JS实现的思维导图工具</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/mind-map">mind-map</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/mind-map">Mind Map</a></p>\n<h3>Angry Pigs</h3>\n<p>Matter.JS物理引擎的Demo</p>\n<p>GitHub地址：<a href="https://silentmaker.github.io/angry-pigs">angry-pigs</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/angry-pigs/">Angry Pigs</a></p>\n<h3>Todos</h3>\n<p>Todos工具，基于PWA</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/todos">todos</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/todos">Todos</a></p>\n<h3>Sprite Generator</h3>\n<p>基于React+Typescript实现的雪碧图制作工具</p>\n<p>GitHub地址：<a href="https://github.com/silentmaker/sprite-generator">sprite-generator</a></p>\n<p>DEMO地址：<a href="https://silentmaker.github.io/sprite-generator">Sprite Generator</a></p>',frontmatter:{title:"迷你项目汇总",tags:null,categories:["编程"],date:"February 15, 2019"}}},pathContext:{slug:"/迷你项目汇总/",previous:{fields:{slug:"/业界观察 - 构建时预渲染/"},frontmatter:{path:"/industry-pratice-pre-ssr",title:"业界观察 - 构建时预渲染",tags:["前端"],categories:["编程"]}},next:{fields:{slug:"/IntersectionObserver和懒加载优化/"},frontmatter:{path:"/intersection-observer-and-lazy-loading",title:"IntersectionObserver和懒加载优化",tags:["前端"],categories:["编程"]}}}}}});
